"""IMPROVED RNN-LSTM"""

import numpy as np
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import SimpleRNN, LSTM, Dense, Dropout
from sklearn.metrics import accuracy_score
from tensorflow.keras.optimizers import Adam

# Assuming Xtrain, Xtest, Ytrain, Ytest are NumPy arrays with one-hot encoded labels

# Reshape input to be [samples, time steps, features]
Xtrain = Xtrain.reshape((Xtrain.shape[0], Xtrain.shape[1], 1))
Xtest = Xtest.reshape((Xtest.shape[0], Xtest.shape[1], 1))

# Define the RNN-LSTM model with improvements
model = Sequential()
model.add(SimpleRNN(100, activation='tanh', return_sequences=True, input_shape=(Xtrain.shape[1], 1)))
model.add(Dropout(0.2))
model.add(LSTM(100, activation='tanh', return_sequences=True))
model.add(Dropout(0.2))
model.add(LSTM(50, activation='tanh'))
model.add(Dense(Ytrain.shape[1], activation='softmax'))

# Compile the model with an adjusted learning rate
optimizer = Adam(learning_rate=0.001)
model.compile(loss='categorical_crossentropy', optimizer=optimizer, metrics=['accuracy'])

# Train the model with adjusted batch size and epochs
model.fit(Xtrain, Ytrain, epochs=200, batch_size=64, verbose=1)

# Predict and evaluate the model
Ypred = model.predict(Xtest)
Ypred_classes = np.argmax(Ypred, axis=1)
accuracy = accuracy_score(np.argmax(Ytest, axis=1), Ypred_classes)
print(f'Improved accuracy of RNN-LSTM model: {accuracy}')